import './HomeSales.css';
import React, {useState, useEffect} from 'react';

function HomeSales() {
    const [products,
        setProducts] = useState([])
    useEffect(async () => {
        // fetch('./lists.json').this((response) => response.json()).this((data) => setProducts(data));
        const res = await fetch('./lists.json');
        const data = await res.json();
        if (res.ok) {
            setProducts(data);
        }
    }, []);

    return (
        <div class="container">

            <table>
                <tr>
                    <th>Product</th>
                    <th>Barcode</th>
                    <th>Price</th>
                    <th>Action</th>
                </tr>
                <tbody>
                    {products.map((product, index) => (
                    <tr class="product" key={index}>
                        <td>{product.name}</td>
                        <td>{product.barcode}</td>
                        <td>{product.price}$</td>
                        <td>
                            <button class="btn btn-outline-success">Add to Cart</button>
                            <button class="btn btn-outline-primary">More Info</button>
                            <button class="btn btn-success">Buy Now</button>
                        </td>
                    </tr>))}
                </tbody>

            </table>

        </div>
    );
}

export default HomeSales
